import 'tachyons';
import { robots } from './robots';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div>
      <Card id={robots[0].id}/>
      <Card id={robots[1].id}/>
      <Card id={robots[2].id}/>
      </div>

  </React.StrictMode>
);




